import Friends from "./Components/Friends";

const Home = () => {
  return (
    <div className="App">
      <h1>Simulador de Inversiones</h1>
      <InvestmentForm addInvestment={addInvestment} />
      <InvestmentList investments={investments} />
      <InvestmentChart data={chartData} />
      <LimitedCounter />
      <RandomImageGallery />
      <CurrencyConverter />
      <TrafficLight />
      <RandomQuoteGenerator />
      <DigitalClock />
      <DogAgeCalculator />
      <ShoppingList />
    </div>
  );
};

export default Home;
